import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  useRouteMatch,
} from "react-router-dom";
import styles from "../modules/Category.module.css";
import TldCategoryList from "./TldCategoryList.js";
import Emojis from "./Emojis.js";
import Names from "./Names.js";
import ThreeLetter from "./ThreeLetter.js";
import TwoLetter from "./TwoLetter.js";
import TopPicks from "./TopPicks.js";

export default function Category() {
  const { path } = useRouteMatch();
  console.log("path", path);
  return (
    <div>
      {/* {path === "/tld" ? (
        <TldCategoryList />
      ) : ( */}
      <Switch>
        <Route path="/tld" exact component={TldCategoryList} />
        <Route path="/tld/category/topPicks" component={TopPicks} />
        <Route path="/tld/category/emojis" component={Emojis} />
        <Route path="/tld/category/names" component={Names} />
        <Route path="/tld/category/threeLetter" component={ThreeLetter} />
        <Route path="/tld/category/twoLetter" component={TwoLetter} />
      </Switch>
      {/* )} */}
    </div>
  );
}
